import React from "react";
import { useHistory } from "react-router-dom";

function Logout() {
  const history = useHistory();

  const logOut = () => {
    history.push("/login");
  };
  return (
    <div className="header">
      <button className="logOutButton"onClick={logOut}></button>
    </div>
  );
}

export default Logout;
